import { createTheme } from '@material-ui/core';

export const darkTheme = createTheme({
  palette: {
    type: "dark",

    background: {
      paper: "#272F3F",
      default: "#181D27",
    },

    primary: {
      main: '#C0330C',
      contrastText: '#FFFBF5',
    },

    secondary: {
      main: '#04724D',
      contrastText: '#FFFBF5',
    },

    text: {
      primary: '#FFFBF5',
    },

    action: {
      focus: "rgba(255, 255, 255, 0.12)",
    },
  },
  
  typography: {
    fontSize: 10,

    h3: {
      marginBottom: "2rem",
    },

    body1: {
      fontSize: 17,
    },
  },
});
